import React, { Component } from 'react';
import './App.css';
import AuthComponent from './components/AuthComponent';

class App extends Component {
  getData(val){
    console.log(val);
  }
  render() {
    return (
      <div className="App">
        <AuthComponent sendData={(val)=>this.getData(val)}/>
      </div>
    );
  }
}

export default App;
